import React from 'react';
import{ View,Text,StyleSheet,TextInput } from 'react-native';

const Login=()=>{
    return(
        <View >
            <View style={styles.inputField}>
              <TextInput />
            </View>
            <View style={styles.inputField}>
              <TextInput />
            </View>


        </View>
    )
}

export default Login;


const styles = StyleSheet.create({
    inputField: {
        backgroundColor: "#FFC0CB",
        borderRadius: 10,
        width: "80%",
        height: 45,
        marginBottom: 20,
        alignItems: "center",
      },
  });
